<?phpnamespace Nemundo\Admin\Parameter;use Nemundo\Core\Type\Geo\GeoCoordinate;use Nemundo\Web\Parameter\AbstractUrlParameter;class GeoCoordinateParameter extends AbstractUrlParameter{    protected function loadParameter()    {        $this->parameterName = 'geo-coordinate';    }    public function getGeoCoordinate() {        $geoCoordinate = (new GeoCoordinate())->fromText($this->getValue());        return $geoCoordinate;    }}